import {useEffect, useState} from "react";
import Navegador from "../../geral/navbar";
import { useNavigate } from "react-router-dom";
import {Form} from "react-bootstrap"


export default function Home(){
    const [summoner, setSummoner] = useState("");
    let navigate = useNavigate();
    function handleClick() {
        navigate(`/summoner/${summoner}`);
      }

    return (
        <div>
            <Navegador/>
            <Form>
                <Form.Group className="mb-3" controlId="exampleForm.ControlInput1">
                <Form.Label>Email address</Form.Label>
                <Form.Control type="text" placeholder="name@example.com" value={summoner} onChange={(e) => setSummoner(e.target.value)} />
                </Form.Group>
                <Button type="submit">Sign in</Button>
            </Form>
            <form>
                <input id="GET-name" type="text" name="name" value={summoner} onChange={(e) => setSummoner(e.target.value)}/>
                <button
                type="button"
                onClick={() => handleClick()}
                >
                    <strong>BUSCAR</strong>
                </button>
            </form>
        </div>
    )
}
